    Commission's notification dated 07/10/09 regarding information contained in the
    above referenced report: 1) Relative to Schedule A, Line 12, please note that
    no portion of the transfers-in from the Democratic National Committee were used
    to fund exempt activities on behalf of any federal candidate. 2) Please be advised
    that Schedule H3 of the Committee's February Monthly (1/1/09-1/31/09), March Monthly
    (2/1/09-2/28/09), and April Monthly (3/1/09-3/31/09) Reports combined disclose
    transfers-in from non-federal accounts for 'Holiday '08' and 'Convention 8/27/08
    AG Reception' that did not exceed the permissible amounts indicated by our allocation
    ratios for these events.  The transfers were made within a 70-day time period:
    no more than 10 days before or 60 days after payment to the vendor.  The transfer
    for a $1,050.39 vendor refund from Westin NY at Times Square refunded to the Committee
    on 2/26/09 was reported on the May Monthly (4/1/09-4/30/09) Report.  This transfer
    was also made within a 70-day time period: no more than 10 days before or 60 days
    after payment to the vendor. 3) Please note the report is being amended to clarify
    the following descriptions: 'Admin & Political Consulting Non-Candidate Specific'
    and 'Intern/Stipend'. 4) Please be advised that the $588.33 reimbursement to Jacqueline
    Cohen disclosed on Schedule B, Line 30(b) was for mileage.  Itemization is not
    necessary for this particular reimbursement.\n"
